import React from 'react';
import './homepage.css';

const homepage = () => {
    return (
        <header className="header">
            <h1 className="h-primary">
                <span className="h-primary-m">PixWebsite</span>
                <span className="h-primary-s">The house of the pixels</span>
            </h1>
        </header>
    );
}

export default homepage;
